            let elements = document.querySelectorAll('path');

            this.initAnimation(elements);

            let progress;
            window.addEventListener('scroll', (e) => {
                const start = 100;
                const end = 401;
                if (window.scrollY >= start) {
                     console.log(window.scrollY);
                     console.log(progress);
                     console.log(end);

                     progress = 100 / (end - start) * (window.scrollY - start);

                    this.elements.forEach( e => {
                        e.seek(e.duration * (progress / 100));
                    });

                    if (window.scrollY >= end) {
                        this.button.visible = true;
                    }
                }
            });
        },
        methods: {
            initAnimation(elements) {
                for (let i = 0; i < elements.length; i++) {

                    let el = elements[i];
                    let offset = anime.setDashoffset(el);
                    el.setAttribute('stroke-dashoffset', offset);

                    if (!this.elements[i]) {
                        this.elements[i] = anime({
                            targets: el,
                            strokeDashoffset: [offset, 0],
                            loop: false,
                            direction: 'alternate',
                            easing: 'linear',
                            autoplay: false,
                        });
                    }
                }
            },
            updateAnimation(elements, progress) {

